script: |
  super -f tsv -I q8534.sql | sort > q8534.out

vector: true

inputs:
  - name: q8534.sql
    data: |
      SELECT ALL 12 AS col2 FROM tab2 WHERE NOT + + ( - - col2 ) * col0 * - + ( + CAST ( + col2 AS INTEGER ) ) IS NULL;
  - name: tab2

outputs:
  - name: q8534.out
    data: |
      12
      12
      12
